import './App.css';

function App() {
  const element ={
    firstName:"Ashish",
    lastName:"Gandhi"
  }
  return (
    <>
    <h1>{element.firstName +' '+ element.lastName}</h1>    
     <h1>Hello, world!</h1>
     <h2>Hello this side ashish</h2>
     <h3>Hi</h3> 
  <h2>It is {new Date().toLocaleTimeString()}.</h2>

  </>
  );

}


export default App;
